window.bookSummaryJSON = "<p>From <i>USA Today</i> best-selling author Meagan Brandy comes an enemies-to-lovers new-adult romance full of morally corrupt and power-driven teenagers.&nbsp;</p> <p>\"Girls like you aren't exactly welcomed at a place like this, so keep your head down and look the other way.\"&nbsp;</p> <p>Those were the exact words of my social worker when she dropped me in my newest hellhole, a place for \"troubled teens\".&nbsp;</p> <p>I didn't listen, and now I'm on their radar.&nbsp;</p> <p>They expect me to play along in their games of hierarchy, to fall in line in the social order they've deemed me fit for.&nbsp;</p> <p>Too bad for them, I don't follow rules. Too bad for me, they're determined to make sure I do.&nbsp;&nbsp;</p> <p>Inconceivably attractive and treated like kings...these are the boys of Brayshaw High.&nbsp;</p> <p>And I'm the girl who got in their way.&nbsp;</p> <p><i>This is book one in a three-book series.</i></p>"; 
